import axios from "axios"; 

export default function MainApp(){


    return(
        <div>
            <h1>Lowest rated parking lots!</h1>
            <h4>Ratings lower than 3 stars.</h4>
            <div>
                <form>
                    <input type="text" required placeholder="Enter a city"></input>
                    <input type="submit"></input>
                </form>
            </div>
        </div>
    );
}
